import React from 'react';
import Picker from './Picker';
import {Route, NavLink, HashRouter} from 'react-dom';

/**
 * Simple component with no state.
 *
 * See the basic-react from lecture 11 for an example of adding and
 * reacting to changes in state.
 */
class App extends React.Component {
  /**
   * @return {object} a <div> containing an <h2>
   */
  render() {
    return (
      <HashRouter>
        <h2 id='welcome'>CSE183 Assignment 5 - React I</h2>
        <ul className = "navigation">
          <li><NavLink exact to="./Picker">Picker</NavLink></li>
        </ul>
        <div>
          <Route exact path="/" component={Picker}/>
        </div>
      </HashRouter>
    );
  }
}

export default App;
